@testset "7.2.5 Inverse hyperbolic cosine functions" begin
    @variables a, b, c, d, d1, d2, e, f, g, h, m, n, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*u*(a+b*acosh(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*acosh(c*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*acosh(c*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(d + e*x)^3*acosh(c*x), x, 5, -((7*d*sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^2)/(48*c)) - (sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^3)/(16*c) - (sqrt(-1 + c*x)*sqrt(1 + c*x)*(4*d*(19*c^2*d^2 + 16*e^2) + e*(26*c^2*d^2 + 9*e^2)*x))/(96*c^3) - ((8*c^4*d^4 + 24*c^2*d^2*e^2 + 3*e^4)*acosh(c*x))/(32*c^4*e) + ((d + e*x)^4*acosh(c*x))/(4*e)]
    @test_int [(d + e*x)^2*acosh(c*x), x, 4, -((sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^2)/(9*c)) - (sqrt(-1 + c*x)*sqrt(1 + c*x)*(4*(4*c^2*d^2 + e^2) + 5*c^2*d*e*x))/(18*c^3) - (1/6)*d*((2*d^2)/e + (3*e)/c^2)*acosh(c*x) + ((d + e*x)^3*acosh(c*x))/(3*e)]
    @test_int [(d + e*x)^1*acosh(c*x), x, 4, -((3*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(4*c)) - (sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x))/(4*c) - (1/4)*((2*d^2)/e + e/c^2)*acosh(c*x) + ((d + e*x)^2*acosh(c*x))/(2*e)]
    @test_int [acosh(c*x)/(d + e*x)^1, x, 8, -(acosh(c*x)^2/(2*e)) + (acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/e + (acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/e + PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/e + PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/e]
    @test_int [acosh(c*x)/(d + e*x)^2, x, 3, -(acosh(c*x)/(e*(d + e*x))) + (2*c*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(sqrt(c*d - e)*e*sqrt(c*d + e))]
    @test_int [acosh(c*x)/(d + e*x)^3, x, 4, -((c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c^2*d^2 - e^2)*(d + e*x))) - acosh(c*x)/(2*e*(d + e*x)^2) + (c^3*d*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/((c*d - e)^(3/2)*e*(c*d + e)^(3/2))]
    @test_int [acosh(c*x)/(d + e*x)^4, x, 6, If($VersionNumber>=8, -((c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*(c^2*d^2 - e^2)*(d + e*x)^2)) - (c^3*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c*d - e)^2*(c*d + e)^2*(d + e*x)) - acosh(c*x)/(3*e*(d + e*x)^3) + (c^3*(2*c^2*d^2 + e^2)*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(3*(c*d - e)^(5/2)*e*(c*d + e)^(5/2)), -((c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*(c^2*d^2 - e^2)*(d + e*x)^2)) - (c^3*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c^2*d^2 - e^2)^2*(d + e*x)) - acosh(c*x)/(3*e*(d + e*x)^3) + (c^3*(2*c^2*d^2 + e^2)*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(3*(c*d - e)^(5/2)*e*(c*d + e)^(5/2)))]


    @test_int [(d + e*x)^3*acosh(c*x)^2, x, 18, 2*d^3*x + (4*d*e^2*x)/(3*c^2) + (3/4)*d^2*e*x^2 + (3*e^3*x^2)/(32*c^2) + (2/9)*d*e^2*x^3 + (e^3*x^4)/32 - (2*d^3*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/c - (4*d*e^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(3*c^3) - (3*d^2*e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(2*c) - (3*e^3*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(16*c^3) - (2*d*e^2*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(3*c) - (e^3*x^3*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(8*c) - (d^4*acosh(c*x)^2)/(4*e) - (3*d^2*e*acosh(c*x)^2)/(4*c^2) - (3*e^3*acosh(c*x)^2)/(32*c^4) + ((d + e*x)^4*acosh(c*x)^2)/(4*e)]
    @test_int [(d + e*x)^2*acosh(c*x)^2, x, 13, 2*d^2*x + (4*e^2*x)/(9*c^2) + (1/2)*d*e*x^2 + (2*e^2*x^3)/27 - (2*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/c - (4*e^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(9*c^3) - (d*e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/c - (2*e^2*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(9*c) - (d^3*acosh(c*x)^2)/(3*e) - (d*e*acosh(c*x)^2)/(2*c^2) + ((d + e*x)^3*acosh(c*x)^2)/(3*e)]
    @test_int [(d + e*x)^1*acosh(c*x)^2, x, 9, 2*d*x + (e*x^2)/4 - (2*d*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/c - (e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*acosh(c*x))/(2*c) - (d^2*acosh(c*x)^2)/(2*e) - (e*acosh(c*x)^2)/(4*c^2) + ((d + e*x)^2*acosh(c*x)^2)/(2*e)]
    @test_int [acosh(c*x)^2/(d + e*x)^1, x, 10, -(acosh(c*x)^3/(3*e)) + (acosh(c*x)^2*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/e + (acosh(c*x)^2*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/e + (2*acosh(c*x)*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/e + (2*acosh(c*x)*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/e - (2*PolyLog(3, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/e - (2*PolyLog(3, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/e]
    @test_int [acosh(c*x)^2/(d + e*x)^2, x, 10, -(acosh(c*x)^2/(e*(d + e*x))) + (2*c*acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/(e*sqrt(c^2*d^2 - e^2)) - (2*c*acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/(e*sqrt(c^2*d^2 - e^2)) + (2*c*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/(e*sqrt(c^2*d^2 - e^2)) - (2*c*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/(e*sqrt(c^2*d^2 - e^2))]
    @test_int [acosh(c*x)^2/(d + e*x)^3, x, 13, -((c*sqrt(-((1 - c*x)/(1 + c*x)))*(1 + c*x)*acosh(c*x))/((c^2*d^2 - e^2)*(d + e*x))) - acosh(c*x)^2/(2*e*(d + e*x)^2) + (c^3*d*acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/(e*(c^2*d^2 - e^2)^(3/2)) - (c^3*d*acosh(c*x)*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/(e*(c^2*d^2 - e^2)^(3/2)) + (c^2*log(d + e*x))/(e*(c^2*d^2 - e^2)) + (c^3*d*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/(e*(c^2*d^2 - e^2)^(3/2)) - (c^3*d*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/(e*(c^2*d^2 - e^2)^(3/2))]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*acosh(c*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(d + e*x)^3*(a + b*acosh(c*x)), x, 5, -((7*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^2)/(48*c)) - (b*sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^3)/(16*c) - (b*sqrt(-1 + c*x)*sqrt(1 + c*x)*(4*d*(19*c^2*d^2 + 16*e^2) + e*(26*c^2*d^2 + 9*e^2)*x))/(96*c^3) - (b*(8*c^4*d^4 + 24*c^2*d^2*e^2 + 3*e^4)*acosh(c*x))/(32*c^4*e) + ((d + e*x)^4*(a + b*acosh(c*x)))/(4*e)]
    @test_int [(d + e*x)^2*(a + b*acosh(c*x)), x, 4, -((b*sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x)^2)/(9*c)) - (b*sqrt(-1 + c*x)*sqrt(1 + c*x)*(4*(4*c^2*d^2 + e^2) + 5*c^2*d*e*x))/(18*c^3) - (b*d*(2*d^2 + (3*e^2)/c^2)*acosh(c*x))/(6*e) + ((d + e*x)^3*(a + b*acosh(c*x)))/(3*e)]
    @test_int [(d + e*x)^1*(a + b*acosh(c*x)), x, 4, -((3*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(4*c)) - (b*sqrt(-1 + c*x)*sqrt(1 + c*x)*(d + e*x))/(4*c) - (b*(2*d^2 + e^2/c^2)*acosh(c*x))/(4*e) + ((d + e*x)^2*(a + b*acosh(c*x)))/(2*e)]
    @test_int [(a + b*acosh(c*x))/(d + e*x)^1, x, 8, -((a + b*acosh(c*x))^2/(2*b*e)) + ((a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/e + ((a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/e + (b*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/e + (b*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/e]
    @test_int [(a + b*acosh(c*x))/(d + e*x)^2, x, 3, -((a + b*acosh(c*x))/(e*(d + e*x))) + (2*b*c*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(sqrt(c*d - e)*e*sqrt(c*d + e))]
    @test_int [(a + b*acosh(c*x))/(d + e*x)^3, x, 4, -((b*c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c^2*d^2 - e^2)*(d + e*x))) - (a + b*acosh(c*x))/(2*e*(d + e*x)^2) + (b*c^3*d*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/((c*d - e)^(3/2)*e*(c*d + e)^(3/2))]
    @test_int [(a + b*acosh(c*x))/(d + e*x)^4, x, 6, If($VersionNumber>=8, -((b*c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*(c^2*d^2 - e^2)*(d + e*x)^2)) - (b*c^3*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c*d - e)^2*(c*d + e)^2*(d + e*x)) - (a + b*acosh(c*x))/(3*e*(d + e*x)^3) + (b*c^3*(2*c^2*d^2 + e^2)*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(3*(c*d - e)^(5/2)*e*(c*d + e)^(5/2)), -((b*c*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*(c^2*d^2 - e^2)*(d + e*x)^2)) - (b*c^3*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*(c^2*d^2 - e^2)^2*(d + e*x)) - (a + b*acosh(c*x))/(3*e*(d + e*x)^3) + (b*c^3*(2*c^2*d^2 + e^2)*atanh((sqrt(c*d + e)*sqrt(1 + c*x))/(sqrt(c*d - e)*sqrt(-1 + c*x))))/(3*(c*d - e)^(5/2)*e*(c*d + e)^(5/2)))]


    @test_int [(d + e*x)^3*(a + b*acosh(c*x))^2, x, 18, 2*b^2*d^3*x + (4*b^2*d*e^2*x)/(3*c^2) + (3/4)*b^2*d^2*e*x^2 + (3*b^2*e^3*x^2)/(32*c^2) + (2/9)*b^2*d*e^2*x^3 + (1/32)*b^2*e^3*x^4 - (2*b*d^3*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/c - (4*b*d*e^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(3*c^3) - (3*b*d^2*e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(2*c) - (3*b*e^3*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(16*c^3) - (2*b*d*e^2*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(3*c) - (b*e^3*x^3*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(8*c) - (d^4*(a + b*acosh(c*x))^2)/(4*e) - (3*d^2*e*(a + b*acosh(c*x))^2)/(4*c^2) - (3*e^3*(a + b*acosh(c*x))^2)/(32*c^4) + ((d + e*x)^4*(a + b*acosh(c*x))^2)/(4*e)]
    @test_int [(d + e*x)^2*(a + b*acosh(c*x))^2, x, 13, 2*b^2*d^2*x + (4*b^2*e^2*x)/(9*c^2) + (1/2)*b^2*d*e*x^2 + (2/27)*b^2*e^2*x^3 - (2*b*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/c - (4*b*e^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(9*c^3) - (b*d*e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/c - (2*b*e^2*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(9*c) - (d^3*(a + b*acosh(c*x))^2)/(3*e) - (d*e*(a + b*acosh(c*x))^2)/(2*c^2) + ((d + e*x)^3*(a + b*acosh(c*x))^2)/(3*e)]
    @test_int [(d + e*x)^1*(a + b*acosh(c*x))^2, x, 9, 2*b^2*d*x + (1/4)*b^2*e*x^2 - (2*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/c - (b*e*x*sqrt(-1 + c*x)*sqrt(1 + c*x)*(a + b*acosh(c*x)))/(2*c) - (d^2*(a + b*acosh(c*x))^2)/(2*e) - (e*(a + b*acosh(c*x))^2)/(4*c^2) + ((d + e*x)^2*(a + b*acosh(c*x))^2)/(2*e)]
    @test_int [(a + b*acosh(c*x))^2/(d + e*x)^1, x, 10, -((a + b*acosh(c*x))^3/(3*b*e)) + ((a + b*acosh(c*x))^2*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/e + ((a + b*acosh(c*x))^2*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/e + (2*b*(a + b*acosh(c*x))*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/e + (2*b*(a + b*acosh(c*x))*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/e - (2*b^2*PolyLog(3, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/e - (2*b^2*PolyLog(3, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/e]
    @test_int [(a + b*acosh(c*x))^2/(d + e*x)^2, x, 10, -((a + b*acosh(c*x))^2/(e*(d + e*x))) + (2*b*c*(a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/(e*sqrt(c^2*d^2 - e^2)) - (2*b*c*(a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/(e*sqrt(c^2*d^2 - e^2)) + (2*b^2*c*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/(e*sqrt(c^2*d^2 - e^2)) - (2*b^2*c*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/(e*sqrt(c^2*d^2 - e^2))]
    @test_int [(a + b*acosh(c*x))^2/(d + e*x)^3, x, 13, -((b*c*sqrt(-((1 - c*x)/(1 + c*x)))*(1 + c*x)*(a + b*acosh(c*x)))/((c^2*d^2 - e^2)*(d + e*x))) - (a + b*acosh(c*x))^2/(2*e*(d + e*x)^2) + (b*c^3*d*(a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2))))/(e*(c^2*d^2 - e^2)^(3/2)) - (b*c^3*d*(a + b*acosh(c*x))*log(1 + (e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2))))/(e*(c^2*d^2 - e^2)^(3/2)) + (b^2*c^2*log(d + e*x))/(e*(c^2*d^2 - e^2)) + (b^2*c^3*d*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d - sqrt(c^2*d^2 - e^2)))))/(e*(c^2*d^2 - e^2)^(3/2)) - (b^2*c^3*d*PolyLog(2, -((e*ℯ^acosh(c*x))/(c*d + sqrt(c^2*d^2 - e^2)))))/(e*(c^2*d^2 - e^2)^(3/2))]


    #= ::Subsubsection::Closed:: =#
