    @test_int [x^3*acosh(a + b*x^4), x, 4, -((sqrt(-1 + a + b*x^4)*sqrt(1 + a + b*x^4))/(4*b)) + ((a + b*x^4)*acosh(a + b*x^4))/(4*b)]

    @test_int [x^(n-1)*acosh(a + b*x^n), x, 4, -((sqrt(-1 + a + b*x^n)*sqrt(1 + a + b*x^n))/(b*n)) + ((a + b*x^n)*acosh(a + b*x^n))/(b*n)]


    @test_int [acosh(c/(a + b*x)), x, 5, ((a + b*x)*asech(a/c + (b*x)/c))/b - (2*c*atan(sqrt(((1 - a/c)*c - b*x)/(a + c + b*x))))/b]


    @test_int [acosh(sqrt(1 + b*x^2))^n/sqrt(1 + b*x^2), x, 2, (sqrt(-1 + sqrt(1 + b*x^2))*sqrt(1 + sqrt(1 + b*x^2))*acosh(sqrt(1 + b*x^2))^(1 + n))/(b*(1 + n)*x)]
    @test_int [1/(acosh(sqrt(1 + b*x^2))*sqrt(1 + b*x^2)), x, 2, (sqrt(-1 + sqrt(1 + b*x^2))*sqrt(1 + sqrt(1 + b*x^2))*log(acosh(sqrt(1 + b*x^2))))/(b*x)]
    end
